import React from 'react';
import Link from 'next/link';

class Index extends React.Component{
	render(){
		return(
		<div>
		  	<h1>Welcome to Index Page</h1>
		  	<Link href="/">
		  	<a> Home </a>
		  	</Link>
		  	<Link href="/about">
		  	<a> About </a>
		  	</Link>
		  	<Link href="/portfolio">
		  	<a> Portfolio </a>
		  	</Link>
		  	<Link href="/blogs">
		  	<a> Blogs </a>
		  	</Link>
		  	<a href="/about"> About </a>
		  	<a href="/portfolio"> Portfolio </a>
		  	<a href="/blogs"> Blogs </a>
	  	</div>
	  	)
	}
}
export default Index;
